    false,nt"url": null,nt"notes": "NODC accession 0113820 includes physical
    and underway data collected aboard the ATLANTIS during cruise AT15-26 in the North
    Pacific Ocean from 2007-11-13 to 2007-12-03. These data include CURRENT SPEED -
    EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments
    used to collect these data include ADCP and GPS. These data were collected by Lauren
    Mullineaux of Woods Hole Oceanographic Institution as part of Oceanographic and
    Topographic Influences on Dispersal of Hydrothermal Vent Species. The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program. The ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
